import styled from 'styled-components';

export const Container = styled.p`
    display: flex;
    flex-wrap: wrap;
    align-content: flex-start;
    align-items: flex-start;
    justify-content: flex-start;
    outline-style: solid;
    height: 8rem;
    width: 400px;
    padding: 25px;
    margin: 0px;
`;


export const ContainerLabels = styled.p`
    display: flex;
    flex-wrap: nowrap;
    align-items: flex-start;
    align-content: center;
    justify-content: flex-start; 
    outline-style: solid;
    outline-color: blue;
    width: 100%;
    height: 5rem;
    padding: 0px;
    margin: 0px;
`;


export const Label = styled.p`
    color: #000000;
    font-family: "poppins";
    font-size: 24px;
    outline-style: solid;
    width: 50%;
    display: flex;
    height: 3rem;
`;

export const Result = styled.p`
    color: #F7B718;
    font-family: "poppins";
    outline-style: solid;
    font-size: 40px;
    display: flex;
    height: 3rem;
`;

export const Slider = styled.input`
    color: #000000;
    outline-style: solid;
    width: 100%;
`;
